// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MarketPlace is ERC721Enumerable, Ownable {
  using Counters for Counters.Counter;

  // tokens counter
  Counters.Counter public _tokenIds;

  // contract owner
  address public contractOwner;

  // number of tokens we have on sale
  uint256 public nTokenOnSale;

  // tokens data which represents nft token
  struct tokenData {
    uint256 price;
    string data;
    bool onSale;
    uint256 tokenID;
    address creator;
  }

  /// @dev Base token URI used as a prefix by tokenURI().
  string public baseTokenURI;

  // mapping of token's info token -> token info
  mapping(uint256 => tokenData) public tokensData;

  constructor() ERC721("MarketPlace", "MPE") {
    contractOwner = msg.sender;
    baseTokenURI = "https://df52-194-44-99-188.ngrok.io/api/nfts/";
  }

  /// @dev Returns an URI for a given token ID
  function _baseURI() internal view virtual override returns (string memory) {
    return baseTokenURI;
  }

  /// @dev Sets the base token URI prefix.
  function setBaseTokenURI(string memory _baseTokenURI) public onlyOwner {
    baseTokenURI = _baseTokenURI;
  }

  /**
  Mint new NFT token
  @param receptor {address} to whom we mint NFT token
  @param metadata    {string} configuration json for NFT creation (all NFT metadata here)
  @param price    {uint256} the price in weis
  @return {uint256} returns newly created NFT
  */
  function mint(
    address receptor,
    string memory metadata,
    uint256 price,
    address creator
  ) public returns (uint256) {
    // only contract owner can mint NFTs
    // contract owner can mint NFTs for other users as well using creator param 
    require(
      msg.sender == contractOwner,
      "only contract owner can mint NFT"
    );

    // get latest created nft
    uint256 newItemId = _tokenIds.current();

    // increment token number
    _tokenIds.increment();

    // mint new nft token
    _mint(receptor, newItemId);

    // aggregate all metadata for token
    tokensData[newItemId].data = metadata;
    tokensData[newItemId].price = price;
    tokensData[newItemId].onSale = true;
    tokensData[newItemId].tokenID = newItemId;
    tokensData[newItemId].creator = creator;

    // change number of tokens we have on sale now
    nTokenOnSale++;
    return newItemId;
  }

  /**
    Transfer NFT from one account to another
    @param to {address} to whom we need to transfer NFT token
    @param tokenId {uint256} NFT token id we gonna transfer
    @return {addresss} returns address to whom we transfered NFT
  */
  function transferNFT(address to, uint256 tokenId) public returns (address) {
    require(_exists(tokenId), "Token id doesn't exist");
    require(
      msg.sender == ownerOf(tokenId),
      "Token doesn't belong to caller"
    );

    // perform transfer to `to` address of token `tokenId`
    safeTransferFrom(msg.sender, to, tokenId);

    // return address of new token owner
    return to;
  }

  /**
    resell NFT token on martketplace
    *@param tokenid {uint256} NFT token we gonna resell
    *@param price  {uint256} new price we put for this token
    */
  function resell(uint256 tokenid, uint256 price) public {
    require(
        ownerOf(tokenid) == msg.sender,
        "only NFT token owner can resell it"
    );
    require(price > 0, "NFT token price should be set higher 0");
    tokensData[tokenid].onSale = true;
    tokensData[tokenid].price = price;
    nTokenOnSale++;
  }

  /**
    * disables NFT token from marketplace, it cannot be sold or shown on marketplace
    *@param tokenid {uint256} tokenid representa el token al cual afectar
    */
  function hideNFTFromMarketplace(uint256 tokenid) public {
    // check if caller is token owner
    require(
      ownerOf(tokenid) == msg.sender,
      "only token owner can disable nft token from marketplace"
    );

    // check if token id is in proper range
    require(
      tokenid < _tokenIds.current(),
      "non existing token id"
    );

    tokensData[tokenid].onSale = false;
    nTokenOnSale--;
  }

  /**
    * lists all available NFTs
    *@return tokenData[] list with all NFTs
    */
  function listAllNFTs() public view returns (tokenData[] memory) {
    // get number of tokens
    uint256 nTokens = _tokenIds.current();
    // prepare list for NFTs
    tokenData[] memory onSaleTokensData = new tokenData[](nTokens);
    // pull NFTs one by one into NFT array
    for (uint256 index = 0; index < nTokens; index++) {
        onSaleTokensData[index] = tokensData[index];
    }

    // return list of NFTs
    return onSaleTokensData;
  }

  event buyed(
    address tokenon,
    uint256 payout,
    address tokencre,
    uint256 reg,
    address mpowner,
    uint256 gains
  );

  /**
    buy NFT token
    *@param tokenId {uint256} NFT token id user can buy
    */
  function buyNFT(uint256 tokenId) public payable {
    // check if user has enough funds
    require(msg.value == tokensData[tokenId].price, "insufficient funds");

    // token has to be on sale to be sold
    require(
        tokensData[tokenId].onSale,
        "token is not on sale"
    );

    // set payable for token owner
    address payable tokenOwner = payable(ownerOf(tokenId));
    // set payable for token creator (take creator address from nft token)
    address payable tokenCreator = payable(tokensData[tokenId].creator);

    // send NFT token to the buyer
    _transfer(tokenOwner, msg.sender, tokenId);

    // calculates fees for token owner / creator / contract owner
    uint256 royalty = msg.value * 4 / 100;
    uint256 gains = msg.value * 2 / 100;
    uint256 payout = msg.value * 94 / 100;

    // send main amount to NFT token owner (major part of amount)
    tokenOwner.transfer(payout);

    // send royalty to token creator
    tokenCreator.transfer(royalty);

    // send gains (how much on fee we earned) to contract owner
    payable(contractOwner).transfer(gains);

    // take NFT token from sale
    tokensData[tokenId].onSale = false;
    emit buyed(
      tokenOwner,
      payout,
      tokenCreator,
      royalty,
      contractOwner,
      gains
    );
    nTokenOnSale--;
  }

  /**
    * @param owner {address} address of tokens owner
    * @return tokenData[] list of tokens info which owner owns
    */
  function tokensOf(address owner) public view returns (tokenData[] memory) {
    // how many tokens adderss has 
    uint256 nTokens = balanceOf(owner);
    if (nTokens == 0) {
      return (new tokenData[](nTokens));
    }

    // initialize array of tokens for responding with list of nfts per address it owns
    tokenData[] memory userTokens = new tokenData[](nTokens);

    for (uint256 i = 0; i < nTokens; i++) {
      // collect token info by token owner and save into the list
      userTokens[i] = tokensData[tokenOfOwnerByIndex(owner, i)];
    }

    // return list of tokens data
    return (userTokens);
  }

  // gets all NFT token info by token id
  function getItemInfo(uint256 _token)
    public
    view
    returns (tokenData[] memory)
  {
    tokenData[] memory getone = new tokenData[](1);
    getone[0] = tokensData[_token];
    return getone;
  }
}

